<?php

# @autogenerated
declare(strict_types=1);

use Civi\Lughauth\Features\Test\Plan\PlanTenant\Domain\ValueObject\PlanTenantNameVO;
use Civi\Lughauth\Features\Test\Plan\PlanTenant\Domain\ValueObject\PlanTenantVersionVO;
use Civi\Lughauth\Features\Test\Plan\PlanTenant\Domain\PlanTenantAttributes;
use PHPUnit\Framework\TestCase;

final class PlanTenantAttributesUnitTest extends TestCase
{
    public function test(): void
    {
        $value = new PlanTenantAttributes();
        $nameOneValue = 'one';
        $nameOtherValue = 'other';
        $copy = $value->name($nameOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getName());
        $this->assertNotEquals('other', $value->getName());
        $this->assertEquals('one', $value->getNameOrDefault(PlanTenantNameVO::from($nameOtherValue))->value());
        $this->assertNotEquals('other', $value->getNameOrDefault(PlanTenantNameVO::from($nameOtherValue))->value());
        $value->unsetName();
        $this->assertEquals('other', $value->getNameOrDefault(PlanTenantNameVO::from($nameOtherValue))->value());
        $this->assertNotEquals('one', $value->getNameOrDefault(PlanTenantNameVO::from($nameOtherValue))->value());
        $versionOneValue = 1;
        $versionOtherValue = 2;
        $copy = $value->version($versionOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(1, $value->getVersion());
        $this->assertNotEquals(2, $value->getVersion());
        $this->assertEquals(1, $value->getVersionOrDefault(PlanTenantVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(2, $value->getVersionOrDefault(PlanTenantVersionVO::from($versionOtherValue))->value());
        $value->unsetVersion();
        $this->assertEquals(2, $value->getVersionOrDefault(PlanTenantVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(1, $value->getVersionOrDefault(PlanTenantVersionVO::from($versionOtherValue))->value());
        $this->assertSame($value, $copy);
    }
}
